from collections import deque
from typing import List

class Node:
    def __init__(self, val, idx):
        self.val = val
        self.idx = idx
        self.edges = []
        self.visited = False

class Solution:
    def minJumps(self, arr: List[int]) -> int:
        d = {}

        # create graph with nodes that have edges from i-1,i+1,and a[i]==a[j]
        for i,n in enumerate(arr):
            node = Node(n,i)

            # add edge from curr node to prev node and vice versa
            # skip first node as there will be no previous
            if i > 0 and i < len(arr):
                node.edges.append(d[arr[i-1]][len(d[arr[i-1]])-1])
                d[arr[i-1]][len(d[arr[i-1]])-1].edges.append(node)

            # add edges between existing nodes with same val
            if d.get(n):
                # for pnode in d[n]:
                #     if i - pnode.idx > 1:
                #         pnode.edges.append(node)
                #         node.edges.append(pnode)
                d[n].append(node)
            else:
                d[n] = [node]

        # bfs through graph to find shortest path to last node in arr
        # store parents along the way   
        q = deque()
        curr = d[arr[0]][0]
        p = {}

        curr.visited = True
        while curr:
            if curr.idx == len(arr)-1:
                break
            else:
                for n in curr.edges:
                    if not n.visited:
                        n.visited = True
                        q.append(n)
                        p[n.idx] = curr
                
                # loop thru edges that are a[i] == a[j]
                for n in d[curr.val]:
                    if not n.visited:
                        n.visited = True
                        q.append(n)
                        p[n.idx] = curr
                    d[curr.val] = []

            if len(q) > 0:
                curr = q.popleft()
            else:
                break

        steps = 0
        if curr and curr.idx == len(arr)-1:
            # loop thru parents and count number of steps from target to root
            parent = curr
            while parent.idx != 0:
                steps += 1
                parent = p[parent.idx]

        return steps

